// src/assets/logos.ts
// Archivo para almacenar los logos como constantes

/**
 * Logo principal en formato base64
 * Reemplaza el string siguiente con el base64 de tu logo
 */
export const MAIN_LOGO_BASE64 = "data:image/png;base64,"

/**
 * Dimensiones originales del logo
 * Ajusta estos valores a las dimensiones reales de tu logo
 */
export const LOGO_DIMENSIONS = {
  width: 801, // Ajusta esto a las dimensiones reales de tu logo
  height: 311,  // Ajusta esto a las dimensiones reales de tu logo
};

/**
 * Función para obtener dimensiones proporcionales según el ancho deseado
 */
export const getScaledDimensions = (desiredWidth: number) => {
    const aspectRatio = LOGO_DIMENSIONS.width / LOGO_DIMENSIONS.height;
    return {
      width: desiredWidth,
      height: Math.round(desiredWidth / aspectRatio)
    };
  };
  
  /**
   * Función para obtener dimensiones proporcionales según la altura deseada
   */
  export const getScaledDimensionsByHeight = (desiredHeight: number) => {
    const aspectRatio = LOGO_DIMENSIONS.width / LOGO_DIMENSIONS.height;
    return {
      width: Math.round(desiredHeight * aspectRatio),
      height: desiredHeight
    };
  };
  
  /**
   * Función para calcular dimensiones conservando el área original
   * Útil para logos que necesitan mantener su impacto visual
   */
  export const getScaledDimensionsPreservingArea = (scaleFactor: number) => {
    // Calcula el área original
    const originalArea = LOGO_DIMENSIONS.width * LOGO_DIMENSIONS.height;
    
    // Calcula el nuevo área basado en el factor de escala
    const newArea = originalArea * scaleFactor;
    
    // Mantiene la proporción original
    const aspectRatio = LOGO_DIMENSIONS.width / LOGO_DIMENSIONS.height;
    
    // Calcula nuevas dimensiones
    const newHeight = Math.sqrt(newArea / aspectRatio);
    const newWidth = newHeight * aspectRatio;
    
    return {
      width: Math.round(newWidth),
      height: Math.round(newHeight)
    };
  };